import React from 'react';

function Home() {
    return (
        <div class='content1'>
            <h2 className="flex-logo">Welcome to AI Services Company</h2>
            <p>We provide responsible AI integrations to elevate your business.</p>
            <p><img src='flex-ai-logo.png' width='60%'></img></p>
        </div>
    );
}

export default Home;
